import React from "react";
import Typography from "@material-ui/core/Typography";
import { makeStyles } from "@material-ui/core/styles";
import CssBaseline from "@material-ui/core/CssBaseline";
import Box from "@material-ui/core/Box";
import Container from "@material-ui/core/Container";
import Grid from "@material-ui/core/Grid";
import Paper from "@material-ui/core/Paper";
import clsx from "clsx";
import Orders from "./OrderList";
import FormControl from "@material-ui/core/FormControl";
import InputLabel from "@material-ui/core/InputLabel";
import InputAdornment from "@material-ui/core/InputAdornment";
import IconButton from "@material-ui/core/IconButton";
import AddIcon from "@material-ui/icons/Search";
import OutlinedInput from "@material-ui/core/OutlinedInput";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
  },
  searchBar: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  },
  input: {
    display: "flex",
    justifyContent: "center",
    "& > *": {
      // margin: theme.spacing(2),
      // marginLeft: theme.spacing(30),
      width: "34ch",
    },

    textField: {
      width: "25ch",
    },
  },
  form: {
    margin: theme.spacing(4, 0),
  },

  appBarSpacer: theme.mixins.toolbar,
  content: {
    flexGrow: 1,
    height: "100vh",
    overflow: "auto",
  },
  container: {
    paddingTop: theme.spacing(2),
    paddingBottom: theme.spacing(2),
  },
  paper: {
    padding: theme.spacing(2),
    display: "flex",
    overflow: "auto",
    flexDirection: "column",
  },
}));

function submit(name) {
  console.log(name);
}

// Generate Order Data
function createData(id, date, productName, amount, status) {
  return { id, date, productName, amount, status };
}

export default function Dashboard() {
  const classes = useStyles();

  const rows = [
    createData(0, "16 Mar, 2019", "Arabica Beans", "40", "Pending"),
    createData(1, "16 Mar, 2019", "Excelsa Beans", "20", "Pending"),
    createData(2, "16 Mar, 2019", "Robusta beans", "25.5", "Confirmed"),
    createData(3, "16 Mar, 2019", "Liberica beans", "15", "Confirmed"),
    createData(4, "15 Mar, 2019", "Cat Poo Beans", "100", "Delivered"),
  ];

  const [name, setName] = React.useState("");

  return (
    <div className={classes.root}>
      <CssBaseline />
      {/*To enter name*/}
      <main className={classes.content}>
        <div className={classes.form}>
          <Typography
            component="h4"
            variant="h4"
            align="center"
            color="textPrimary"
            gutterBottom
          >
            Enter your name to track your orders
          </Typography>
          <div className={classes.searchBar}>
            <FormControl
              className={clsx(classes.input, classes.textField)}
              variant="outlined"
            >
              <InputLabel htmlFor="add-search">Search</InputLabel>
              <OutlinedInput
                id="add-search"
                value={name}
                onChange={(e) => {
                  setName(e.target.value);
                }}
                endAdornment={
                  <InputAdornment position="end">
                    <IconButton
                      aria-label="search"
                      onClick={() => {
                        this.submit(name);
                      }}
                      edge="end"
                    >
                      <AddIcon />
                    </IconButton>
                  </InputAdornment>
                }
                labelWidth={50}
              />
            </FormControl>
          </div>
        </div>
        <div className={classes.appBarSpacer} />
        <Container maxWidth="lg" className={classes.container}>
          <Grid container spacing={3}>
            {/* Recent Orders */}
            <Grid item xs={12}>
              <Paper className={classes.paper}>
                <Orders rows={rows} />
              </Paper>
            </Grid>
          </Grid>
          <Box pt={4}></Box>
        </Container>
      </main>
    </div>
  );
}
